        "    extreme_sigmoid_grads = [initial_gradient.item()]\n",
        "    current_grad = initial_gradient\n",
        "\n",
        "    for i in range(1, n_layers):\n",
        "        current_grad = CustomSigmoid.backward(x_extreme, current_grad)\n",
